import React from "react";
import { Link } from "react-router-dom";
import "./homepage.css";
import { motion } from "framer-motion";
import homepagePic from "../Assets/homepagePic.png";

const HomePage = () => {
  const wordVariants = {
    hidden: {
      opacity: 0,
      x: -50,
    },
    visible: {
      opacity: 1,
      x: 0,
      transition: {
        duration: 2,
      },
    },
  };

  return (
    <div className="container">
      <div className="home-content">
        <div className="main-content">
          <div className="content-wrapper">
            <motion.div
              initial="hidden"
              animate="visible"
              variants={wordVariants}
              style={{ display: "inline-block" }}
            >
              <motion.span variants={wordVariants}>JSM</motion.span>
            </motion.div>
            <br />
            <motion.div
              initial="hidden"
              animate="visible"
              variants={wordVariants}
              transition={{ delay: 0.5 }}
              style={{ display: "inline-block" }}
            >
              <motion.span variants={wordVariants}>The</motion.span>
            </motion.div>
            <br />
            <motion.div
              initial="hidden"
              animate="visible"
              variants={wordVariants}
              transition={{ delay: 1 }}
              style={{ display: "inline-block" }}
            >
              <motion.span variants={wordVariants}>Barber</motion.span>
            </motion.div>
          </div>
          <Link to="/services" className="book-now">
            <button>
              <span className="label">Book Now</span>
              <span className="transition"></span>
              <div className="gradient"></div>
            </button>
          </Link>
        </div>
      </div>
    </div>
  );
};

export default HomePage;
